 быть красиво так как пожар туда не дошел! И как сказали местные много тишей где рыба стоит!',0,NULL,NULL,NULL,NULL,'deleted','news',NULL,NULL,NULL,1364127846,'no','yes',1364127846,NULL,0,0,1,'',3),(139,14,0,'Разведка села Платинка','Дорога туда хорошая только до села Весёловка, после до Платинки 15 км. но таких плохих что максимум 30 КМЧ, и еще не разъехаться двум автомобилям! Точнее без лопаты не разъехаться! По дороге всё изрезанно снегоходами, видимо мы не первые! Вдоль реки АЙ 2 года назад горел лес - поетому пеёзажи не очень! Снега в лесу выше калена, но проехать можно, пройти не реально. В следующий раз поднимемся выше еще на 15 км, должно быть красиво так как пожар туда не дошел! И как сказали местные много тишей где рыба стоит!',0,NULL,NULL,NULL,NULL,'deleted','news',NULL,NULL,NULL,1364133501,'no','yes',1364133501,NULL,0,0,0,'',0),(140,14,0,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','news',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(141,14,0,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','news',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(142,18,0,'','',0,NULL,NULL,NULL,NULL,'deleted','news',NULL,NULL,NULL,1364459838,'no','yes',1364459838,NULL,0,0,1,'',0),(143,12,14,'','test',0,NULL,NULL,NULL,NULL,'read','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(144,12,14,'','test + img',0,NULL,NULL,NULL,NULL,'read','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(145,12,14,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(146,12,14,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(147,12,14,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(148,12,14,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(149,12,14,'','test data fix',0,NULL,NULL,NULL,NULL,'read','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0