тва по безопасности дорожного движения NHTSA и Страхового института дорожной безопасности IIHS), уровень цен и распространенность на рынке. Кроме того, учитывались и мнения владельцев.\r\nВ результате лидерство по количеству побед разделили Honda и Toyota&nbsp;&mdash; на счету каждой из них по 4&nbsp;номинации. Лишь на одну позицию хуже выступил Ford. Все остальные&nbsp;&mdash; а это японские Mazda, Subaru и Infiniti, европейские Mercedes-Benz и Volvo, американские Chevrolet и Dodge, а также корейская Hyundai&nbsp;&mdash; смогли стать лучшими только в одной из категорий.\r\nВот как выглядит рейтинг лучших подержанных автомобилей США по версии Edmunds:\r\nсубкомпактные модели:&nbsp;Honda Fitкомпактные седаны:&nbsp;Hyundai Elantraсреднеразмерные седаны:&nbsp;Ford Fusionполноразмерные седаны:&nbsp;Toyota Avalonкупе:&nbsp;Honda Accordкабриолеты:&nbsp;Volvo C70универсалы:&nbsp;Subaru Outbackкомпактные SUV/кроссоверы:&nbsp;Honda CR-Vсреднеразмерные SUV/кроссоверы:&nbsp;Toyota Highlanderполноразмерные SUV/кроссоверы:&nbsp;Mazda CX-9минивэн/вэн:&nbsp;Honda Odysseyкоммерческие фургоны: Dodge/Mercedes-Benz Sprinterкомпактный пикап:&nbsp;Toyota Tacomaполноразмерный пикап:&nbsp;Ford F150премиальный класс:&nbsp;Infiniti G35/G37/G25гибриды:&nbsp;Toyota Priusдвухместные спортивные автомобили:&nbsp;Chevrolet Corvetteспортивные автомобили:&nbsp;Ford Mustang&nbsp;GT\r\nСтоит отметить, что Honda Fit в России официально продается как Honda Jazz, а под именем Ford Fusion в Америке предлагается измененный седан Mondeo.Читать полностью:http://news.drom.ru/25044.html',0,NULL,NULL,NULL,NULL,'new','news',NULL,NULL,NULL,1379478603,'no','no',1379478603,NULL,0,0,0,'',1),(679,14,0,'','&nbsp; &nbsp;Американский автопортал&nbsp;Edmunds&nbsp;опубликовал ежегодный отчет по лучшим подержанным автомобилям 2013&nbsp;года. Из&nbsp;18&nbsp;моделей, ставших лучшими в своих категориях, 11&nbsp;&mdash; автомобили японских марок.\r\n&nbsp; &nbsp;Рейтинг составлялся среди автомобилей 2006-2011 годов выпуска. Основными критериями являлись надежность, безопасность (на&nbsp;основании данных Национального агентства по безопасности дорожного движения NHTSA и Страхового института дорожной безопасности IIHS), уровень цен и распространенность на рынке. Кроме того, учитывались и мнения владельцев.\r\n&nbsp; &nbsp;В результате лидерство по количеству побед разделили Honda и Toyota&nbsp;&mdash; на счету каждой из них по 4&nbsp;номинации. Лишь на одну позицию хуже выступил Ford. Все остальные&nbsp;&mdash; а это японские Mazda, Subaru и Infiniti, европейские Mercedes-Benz и Volvo, американские Chevrolet и Dodge, а также корейская Hyundai&nbsp;&mdash; смогли стать лучшими только в одной из категорий.\r\n&nbsp; &nbsp;Вот как выглядит рейтинг лучших подержанных автомобилей США по версии Edmunds:\r\nсубкомпактные модели:&nbsp;Honda Fit\r\nкомпактные седаны:&nbsp;Hyundai Elantra\r\nсреднеразмерные седаны:&nbsp;Ford Fusion\r\nполноразмерные седаны:&nbsp;Toyota Avalon\r\nкупе:&nbsp;Honda Accord\r\nкабриолеты:&nbsp;Volvo C70\r\nуниверсалы:&nbsp;Subaru Outback\r\nкомпактные SUV/кроссоверы:&nbsp;Honda CR-V\r\nсреднеразмерные SUV/кроссоверы:&nbsp;Toyota Highlander\r\nполноразмерные SUV/кроссоверы:&nbsp;Mazda CX-9\r\nминивэн/вэн:&nbsp;Honda Odyssey\r\nкоммерческие фургоны: Dodge/Mercedes-Benz Sprinter\r\nкомпактный пикап:&nbsp;Toyota Tacoma\r\nполноразмерный пикап:&nbsp;Ford F150\r\nпремиальный класс:&nbsp;Infiniti G35/G37/G25\r\nгибриды:&nbsp;Toyota Prius\r\nдвухместные спортивные автомобили:&nbsp;Chevrolet Corvette\r\nспортивные автомобили:&nbsp;Ford Mustang&nbsp;GT\r\n&nbsp; &nbsp; Стоит отметить, что Honda Fit в России официально продается как Honda Jazz, а под именем Ford Fusion в Америке предлагается измененный седан Mondeo.\r\nЧитать полностью:http://news.drom.ru/25044.html',0,NULL,NULL,NULL,NULL,'new','news',NULL,NULL,NULL,1379478992,'no','no',1379478992,NULL,0,0,0,'',0),(680,14,13,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),