ULL,NULL,NULL,'deleted','news',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(863,14,0,'Клавиатура и мышь для компьютера становятся бесполезными устройствами','&nbsp; &nbsp;Близится день, когда человек сможет включать компьютеры и прочие гаджеты силой мысли. А способы, которые представлены здесь, &mdash; всего лишь промежуточный вариант.\r\nУправление гаджетами с помощью жестов и наручных браслетов медленно, но верно входит в повседневную жизнь. К примеру, немецкая компания PMDTec представила интерфейс нового поколения для управления компьютером с помощью жестов. С помощью гаджета под названием&nbsp;CamBoard pico&nbsp;пользователь может жестами переключаться между приложениями и управлять ими. Ничего особенного делать не нужно &mdash; всего лишь держать руку на определенном расстоянии от экрана и жестикулировать. Правда, насколько быстро это CamBoard pico появится в обиходе, зависит от производителей мониторов.\r\n&nbsp; &nbsp;Еще одно подобное изобретение &mdash; наручный браслет&nbsp;MYO. Он создан лабораторией Thalmic Labs и также способен управлять компьютером с помощью жестов. Браслет распознает активность мускулов и по Bluetooth передает сигнал гаджету. Это устройство открывает широкие возможности для любителей компьютерных стрелялок, а также людей, которым часто приходится вести презентации. Стоит браслет около $150. Он станет отличным подарком тем, кто хочет, чтобы все в мире происходило по мановению их руки.\r\nисточник: rbc.ru',0,NULL,NULL,NULL,NULL,'new','news',NULL,NULL,NULL,1382883241,'no','no',1382883241,NULL,0,0,0,'',0),(864,14,13,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(865,14,16,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(866,14,16,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(867,14,0,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','news',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(868,28,0,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(869,14,0,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','news',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(870,14,16,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(871,14,13,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(872,14,16,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(873,14,0,'Городские власти могут неплохо сэкономить на вечернем городском освещении, внедрив специальные светящиеся дорожки.','&nbsp; &nbsp;Звезды теперь будут освещать путь в самом прямом смысле: изобретено инновационное покрытие для дорожек, которое светится в темноте. Так что даже выщербленный асфальт в спальном районе ночью будет превращаться в восхитительный Млечный путь.  &nbsp; &nbsp;Новое &mdash; это хорошо забытое старое. Все помнят о светящихся в темноте игрушках и предметах, но только сотрудники британской компании Pro-Teq догадались использовать ту же самую технологию для создания специального покрытия для дорожек. Водостойкое покрытие StarPath распыляется по поверхности асфальта, днем впитывает ультрафиолетовые лучи, а ночью излучает свечение. В состав StarPath входят фосфоресцирующие соединения, но более сложные, нежели те, что используются в светящихся игрушках. Поэтому яркость свечения покрытия зависит от естественного освещения: в ясную лунную ночь дорожка выглядит тусклее, чем в беспросветной темноте. Pro-Teq уже распылили StarPath на некоторых пешеходных дорожках в Кембридже &mdash; процесс занял всего полчаса, и еще через четыре по ним разрешили ходить. В будущем компания собирается предложить свое изобретение для покрытия автобанов и пешеходных дорожек в других городах.\r\nrbc.ru',0,NULL,NULL,NULL,NULL,'new','news',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,'',0),(874,14,0,'Городские власти могут неплохо сэкономить на вечернем городском освещении, внедрив специальные светящиеся дорожки.','&nbsp; &nbsp;Звезды теперь будут освещать путь в самом прямом смысле: изобретено инновационное покрытие для дорожек, которое светится в темноте. Так что даже выщербленный асфальт в спальном районе ночью будет превращаться в восхитительный Млечный путь.\r\n\r\n&nbsp; &nbsp;Новое &mdash; это хорошо забытое старое. Все помнят о светящихся в темноте игрушках и предметах, но только сотрудники британской компании Pro-Teq догадались использовать ту же самую технологию для создания специального покрытия для дорожек. Водостойкое покрытие StarPath распыляется по поверхности асфальта, днем впитывает ультрафиолетовые лучи, а ночью излучает свечение. В состав StarPath входят фосфоресцирующие соединения, но более сложные, нежели те, что используются в светящихся игрушках. Поэтому яркость свечения покрытия зависит от естественного освещения: в ясную лунную ночь дорожка выглядит тусклее, чем в беспросветной темноте. Pro-Teq уже распылили StarPath на некоторых пешеходных дорожках в Кембридже &mdash; процесс занял всего полчаса, и еще через четыре по ним разрешили ходить. В будущем компания собирается предложить свое изобретение для покрытия автобанов и пешеходных дорожек в других городах.\r\nrbc.ru',0,NULL,NULL,NULL,NULL,'new','news',NULL,NULL,NULL,1383017464,'no','no',1383017464,NULL,0,0,0,'',1),(875,14,0,'Новый робот-пылесос совершил революцию в своем сегменте','&nbsp; &nbsp;Нет, это не синопсис пятой части &laquo;Терминатора&raquo;. Это инновационная клининговая система Mab, состоящая из центрального ядра и 908 летающих крошечных роботов.\r\n\r\n&nbsp; &nbsp;Ядро является базой для роботов и управляет процессом: смешивает воду и моющие средства и заливает смесь в мини-механизмы. После чего они разлетаются по помещению и очищают поверхности, улавливая частицы грязи. Затем роботы возвращаются на базу.\r\nСистему можно запрограммировать на требуемую частоту уборки. Кроме того, Mab определяет, в каком режиме убирать различные участки дома.&nbsp;\r\n\r\n&nbsp; &nbsp;Винты мини-роботов снабжены фотоэлементами, позволяющими механизмам работать на солнечной энергии, а саму систему перед использованием нужно подзарядить электричеством. Mab можно синхронизировать cо смартфоном или планшетником и получать оповещения о том, что нужно сменить фильтры или добавить еще воды.',0,NULL,NULL,NULL,NULL,'new','news',NULL,NULL,NULL,1383106114,'no','no',1383106114,NULL,0,0,0,'',0),(876,14,0,'Новая дизайнерская ванна сама себя наполнит и позаботится о температуре воды','&nbsp; &nbsp;В компании Kasch знают, что удовольствие от принятия ванны неизменно омрачается необходимостью следить за тем, чтобы вода в ней не остывала, не переливалась через край и не меняла свой естественный цвет на более невнятный.\r\n\r\n&nbsp; &nbsp;Поэтому они придумали эту самонаполняющуюся ванну, которая за всем следит сама и в которой можно заниматься ровно тем, для чего, собственно, ванна и предназначена, &mdash; лежать и, не отвлекаясь по пустякам, размышлять о вечном.',0,NULL,NULL,NULL,NULL,'new','news',NULL,NULL,NULL,1383106215,'no','no',1383106215,NULL,0,0,0,'',1),(877,14,0,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','news',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(878,14,0,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','news',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(879,14,0,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','news',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(880,14,0,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','news',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(881,14,0,'И так тоже живут люди!!!','&nbsp; &nbsp;Вот так тоже живут люди! Это поселение находится у берегов острова Хайнань (Китай). Как нам объяснили, это народность которая в чем то, давно давно накосячила, вот их и сослали жить на воде! Вот так и живут потому что кто то очень злой и у него память хорошая! А как там быт у них устроен я не знаю, по фото невидно, а нам потробнее не рассказали!',0,NULL,NULL,NULL,NULL,'deleted','news',NULL,NULL,NULL,1383592108,'no','yes',1383592108,NULL,0,0,0,'',0),(882,14,0,'Обезьяний остров!','Обезьяны просто тут офигели. Потому что их здесь обижать запрещенно, а так же пугать топить кидать взрывать ну и все то что нам хотелось бы с ними сделать зи их поведение! Вот и приходится ходить и терпеть, прятать еду, напитки да и вообще все что могут утащить. Потому что им помойму пофигу что тырить!',0,NULL,NULL,NULL,NULL,'new','news',NULL,NULL,NULL,1383592553,'no','no',1383592553,NULL,0,0,0,'',2),(883,14,13,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(884,14,0,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','news',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(885,14,0,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','news',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(886,14,13,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(887,14,13,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(888,14,13,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(889,14,13,'','Так то оно так да не так!',0,NULL,NULL,NULL,NULL,'read','private_message',NULL,NULL,NULL,0,'no','no',1383986148,NULL,0,0,0,NULL,0),(890,14,0,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(891,14,13,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(892,14,23,'','Здарова!',0,NULL,NULL,NULL,NULL,'read','private_message',NULL,NULL,NULL,0,'no','no',1384160812,NULL,0,0,0,NULL,0),(893,14,23,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(894,23,14,'','<p>Привет! как роутер-репитер?</p>',0,NULL,NULL,NULL,NULL,'read','private_message',NULL,NULL,NULL,0,'no','no',1384249643,NULL,0,0,0,NULL