 повышения топливной экономичности автомобиль должен стать легче. В частности, благодаря алюминию компания планирует снизить вес пикапа примерно на 340 кг.\r\n&nbsp; Еще одним способом повышения экономичности станет новый двигатель семейства EcoBoost объемом 2,7 литра с турбонаддувом. До этого, напомним, самый скромный из предлагавшихся для F-150 моторов имел рабочий объем 3,5 литра. Правда, пока не известно, какие мощность и момент будет выдавать новый двигатель. Зато в Ford рассчитывают, что благодаря всем инновациям расход топлива у F-150 составит около 12,6 литров на 100 км (против более чем 16 литров у нынешнего поколения модели).\r\n&nbsp; Кроме того, не исключается и появление гибридной модификации пикапа.\r\n&nbsp; Официальная презентация новинки, как ожидается, состоится 13 января 2014 года (представители Ford официально не говорят, какие конкретно модели будут представлены),&nbsp;а начало продаж в Америке начнется только во второй половине 2014 года. Столь долгий срок ожидания связан с необходимостью серьезного переоборудования сборочных линий из-за перехода на алюминийЧитать полностью:http://news.drom.ru/Ford-F-150-26496.html\r\nрепост www.drom.ru',0,NULL,NULL,NULL,NULL,'new','news',NULL,NULL,NULL,1388030826,'no','no',1388030826,NULL,0,0,0,'',1),(1223,14,13,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(1224,14,13,'','Первую фотку скинь получше! может на почту - пока мы еще конвертер на comironЕ не сделали',0,NULL,NULL,NULL,NULL,'read','private_message',NULL,NULL,NULL,0,'no','no',1388080569,NULL,0,0,0,NULL,0),(1225,14,13,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(1226,14,0,'Супер футболка!','Хочу такую, у них еще штаны есть. Дак это вообще супер. Можно небояться в дороге, в самолете, при поездках далеко. Очень удобно! Еще для автомобиля надо такое покрытие! Кстати а вот и идея!',0,NULL,NULL,NULL,NULL,'deleted','news',NULL,NULL,NULL,1