,NULL,0,0,0,NULL,0),(1304,14,13,'',NULL,0,NULL,NULL,NULL,NULL,'deleted','private_message',NULL,NULL,NULL,0,'no','no',0,NULL,0,0,0,NULL,0),(1305,13,0,'Новая Toyota Camry: больше, тише и с другим дизайном','На моторшоу в Нью-Йорке главной новинкой Toyota стала&hellip; Camry. Та самая, которая является самым продаваемым седаном в США на протяжении последних 12 лет.Сенсация? Не совсем, ибо, как это часто бывает, есть несколько важных нюансов.Во-первых, это не полностью новое поколение Camry, а модернизированная версия автомобиля, пусть рестайлинг и оказался очень серьёзным. А во-вторых, речь сейчас идет об американской &laquo;Камри&raquo;, которая отличается от продаваемого у нас автомобиля. Однако с высокой долей вероятности можно предположить, что скоро аналогичная модернизация доберется и до нас.Самая главная новость состоит в том, что Camry не просто получила чуть другой дизайн. Машина стала больше! Причем довольно существенно. Так, ее длина выросла сразу на 45 мм, а колея увеличилась на 10 мм. Благодаря этому в салоне (особенно на втором ряду кресел) станет еще просторнее.Представители Toyota уверяют, что Camry получила практически все новые кузовные элементы &ndash; другими стали не только бамперы и фары, но и двери, капот, крылья&hellip; Старой осталась только крыша.Покупателей должна порадовать и улучшенная шумоизоляция, другая приборная панель с красивым цветным экраном, беспроводная зарядка для смартфонов.Двигатели остались старыми. Это мотор объемом 2,5 л (180 л.с.) и 3,5 л (270 л.с.), а также гибридный агрегат, который выдает 200 л.с. Но тут стоит еще раз подчеркнуть, что речь идет о двигателях, которые ставятся на американские машины.Продажа обновленной машины начнется в США осенью. Ну а мы надеемся, что в августе этого года на автосалоне в Москве японцы покажут и европейскую версию модернизированной Camry.Источник: http://auto.mail.ru/article/46228-predstavlena_novaya_toyota_camry/',0,NULL,NULL,NULL,NULL,'deleted','news',NULL,NULL,NULL,1397790542,'no','yes