  `edizm` varchar(20) DEFAULT NULL,
  `name_ru` varchar(255) DEFAULT NULL,
  `name_en` varchar(255) DEFAULT NULL,
  `name_ch` varchar(255) DEFAULT NULL,
  `name_it` varchar(255) DEFAULT NULL,
  `descr` mediumtext,
  `name_es` varchar(255) DEFAULT NULL,
  `isveryspecial` int(1) NOT NULL DEFAULT '0',
  `weight` float DEFAULT '0',
  `volume` float DEFAULT '0',
  `w` float DEFAULT '0',
  `h` float DEFAULT '0',
  `d` float DEFAULT '0',
  `sklad` float DEFAULT '0',
  `discount` int(11) NOT NULL DEFAULT '0',
  `primarykey` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`,`currency_id`),
  KEY `ordr` (`ordr`,`visible`),
  KEY `isspecial` (`isspecial`),
  KEY `likes_num` (`likes_num`),
