метанообразной массы. Выдержать раствор 2-5 минут и снова перемешать. заделка швов ГКЛ и ГВЛ: - полученный раствор нанести металлическим шпателем на стыки листов шириной чуть больше армирующей ленты;</p>',NULL,0,0,0,0,0,0,0,0,NULL),(424,27,'   Шпатлевочная смесь \"Волма - Финиш\" гипсовая, 25кг.',395.00,2,'/images/product/424.205x205.jpg',49,5,1,0,0,0,'/images/product/424.jpg',NULL,0,0,'','','   Шпатлевочная смесь \"Волма - Финиш\" гипсовая, 25кг.','','','<p>&nbsp; &laquo;ВОЛМА-Финиш&raquo; - это шпаклевочная, безусадочная сухая смесь на основе гипса тонкого помола с размером частиц не более 0,1мм, минеральных наполнителей, импортных добавок, обеспечивающих повышенную трещиностойкость и хорошую адгезию. Виды оснований: Бетонные, гипсовые, пено- и газобетонные оштукатуренные поверхности, гипсокартонные и гипсоволокнистые листы, пазогребневые гипсовые плиты. Назначение: для финишной (окончательной) отделки стен и потолков внутри помещений любого назначения с целью получения высококачественной поверхности под покраску, оклейку обоями и других видов декоративной отделки; для тонкого выравнивания новых поверхностей, обработанных смесями &laquo;Волма-Слой&raquo;, &laquo;Волма-Слой МН&raquo;, &laquo;Волма-Шов&raquo;; для подготовки гипсокартонных, гипсоволокнистых листов, пазогребневых гипсовых плит к последующей окраске, оклейке обоями; для подготовки оштукатуренных бетонных, пено- и газобетонных поверхностей к последующей окраске и нанесению декоративных покрытий. Требования к основаниям: Основание должно быть сухим, тщательно очищенным от пыли, грязи, масляных и битумных пятен. Малярные покрытия должны быть удалены. Для предотвращения снижения прочности сцепления шпаклевочной смеси, сильновпитывающее основание необходимо прогрунтовать грунтовкой &laquo;ВОЛМА-Универсал&raquo;. Слабовпитывающие основания необходимо обработать грунтовкой &laquo;ВОЛМА-Контакт&raquo;. Гарантийный срок хранения в фирменной упаковке в сухих помещениях 12 месяцев со дня изготовления. Преимущест