ие в помещениях с повышенной влажностью (кухнях и ванных комнатах), при условии обработки оштукатуренной поверхности гидроизоляционной грунтовкой перед дальнейшей отделкой. Технические характеристики : Наименование показателя Значение Внешний вид смеси Однородная, по цвету от белого до серого Расход воды на 1 кг сухой смеси, литр 0,47-0,53 Минимальная толщина нанесения, мм 5 Максимальная толщина нанесения, мм 50 Жизнеспособность готового раствора в открытой таре, мин., не менее 45 Предел прочности при сжатии, МПа, не менее 3,5 Прочность сцепления покрытия с бетонным основанием, МПа, не менее 0,3 Подготовка основания: Поверхность очистить от пыли, грязи, жировых или масляных пятен, отслоений и следов краски. Большие неровности устранить, обработать металлические элементы средством, предотвращающим коррозию. ВНИМАНИЕ! Перед нанесением штукатурки обработать основание соответствующей акриловой грунтовкой. Не допускать запыления загрунтованной поверхности! При необходимости установить маячковые профили. В процессе работы и в течении последующих 2-х дней температура основания и воздуха в помещении должна быть от +5 до +30 С. Приготовление раствора : Для работы использовать чистый инструмент и емкости из нержавеющей стали, алюминия или пластмассы. ВНИМАНИЕ! Загрязненный инструмент и емкости сокращают время использования растворной смеси. Смесь высыпать в емкость с чистой водой комнатной температуры в пропорции 1 кг сухой смеси на 0,47-0,53 л. воды и перемешать, желательно с помощью миксерной насадки (скорость вращения 140-400 об./мин.), до состояния однородной сметанообразной массы. Выдержать раствор 3-5 минут и снова перемешать. Полученный раствор в течении 45 минут от момента затворения водой нанести на поверхность слоем 5-50 мм. Порядок работ : - растворную смесь набросать на подготовленную поверхность кельмой или штукатурным соколом, после чего разровнять h-образным правилом зигзагообразными движениями; - после начала схватывания поверхность выровнять трапециевидным правилом, держа его перпендикулярно к основанию, срезая излишки и заполняя углубления; - при оштукатуривании в два слоя необходимо на первый, еще не затвердевший нанести насечку (можно с помощью зубчатого шпателя). После высыхания первый слой обработать грунтовкой, а затем нанести второй слой штукатурки; - после подрезки, когда нанесенный слой практически затвердеет, поверхность обильно смочить водой, после чего , дождавшись полного впитывания воды затереть кругообразными движениями жесткой губчатой или войлочной теркой и загладить штукатурку широким металлическим шпателем. Время высыхания штукатурки до последующей покраски или оклейки обоями состовляет 3-5 суток, в зависимости от толщины слоя, темпиратуры и влажности воздуха в помещении. Расход смеси: На 1м2 поверхности расходуется 9-11 кг сухой смеси при толщине слоя 10 мм. Хранение : Срок хранения в фирменной неповрежденной упаковке &ndash; 12 месяцев с момента даты изготовления. Мешки хранить на деревянных поддонах в сухих по</p>',NULL,0,0,0,0,0,0,0,0,NULL),(426,27,'Шпатлёвка \"Bergauf\" Finish Polymer полимерная 25кг',390.00,2,'/images/product/426.205x205.jpg',51,5,1,0,0,0,'/images/product/426.jpg',NULL,0,0,'','','Шпатлёвка \"Bergauf\" Finish Polymer полимерная 25кг','','','<p>Финишная шпаклевка Bergauf (&laquo;Вергауф&raquo;) Finish Polymer имеет полимерную основу, образует слой до 3 мм. Шпаклевка финишная &laquo;Вергауф&raquo; является белоснежной, сам раствор жизнеспособен 24 часа. В качестве оснований можно использовать: бетон, цементная штукатурка, цементная штукатурка, гипсовая штукатурка, гипсокартон, ЦСП, ДСП, дерево, фанера. Цементная шпаклевка Finish Polymer наносится перед декоративной штукатуркой, под текстурные и тонкие обои, под финишную шпаклевку, под покраску. Шпаклевка Bergauf применяется в помещениях с нормальной влажностью. Материал наносится ручным способом.</p>\n<p>Характеристики продукта</p>\n<p>Цвет белый <br />Вяжущее полимер <br />Основная фракция менее 0,1 мм <br /><br />Характеристики применения</p>\n<p>Расход сухой смеси на 1 кв. м при слое 1 мм ~1 кг <br />Минимальная толщина нанесения 0 мм <br />Максимальная толщина нанесения 3 мм <br />Жизнеспособность готового раствора в открытой таре 24 часа <br />Шлифовка после нанесения допускается через 4 часа <br />Проведение работ при температуре основания от +5 &deg;С до +25 &deg;С <br /><br />Характеристики эксплуатации</p>\n<p>Прочность сцепления с основанием (через 28 суток) 0,5 МПа</p>',NULL,0,0,0,0,0,0,0,0,NULL),(427,27,'OSB-3 плита древ. 1220*2440*9,0 мм Кronospan (Латвия)',500.00,2,'/images/product/427.205x205.jpeg',52,5,1,0,0,0,'/images/product/427.jpeg',NULL,0,0,'','','OSB-3 плита древ. 1220*2440*9,0 мм Кronospan (Латвия)','','','<p>Плиты ОСП отличает высокая прочность по сравнению с другими плитными материалами. Показатели прочности осп-плит в 2,5 раза выше чем у ДСП и схожи с показателями хвойной фанеры. Высокая влагостойкость. Плиты осб легко поддаются обработке, они без труда режутся и сверлятся. Их можно красить и склеивать любыми материалами подходящими для древесины. Также немаловажным является отсутствие подверженности плит OSB воздействию вредных насекомых.</p>\n<p>Существует несколько типов ОСП</p>\n<p><br />OSB-1 - используют в основном в условиях низкой влажности, для изготовления упаковки, мебели.<br />OSB-2 - применяется для изготовления несущих конструкций в сухих помещениях.</p>\n<p>OSB-3 - применяется для изготовления несущих конструкций в условиях повышенной влажности.</p>\n<p>Применение ОСП плит<br /><br /> Плиты ОСП применяюся для обшивки стен, в последствии могут покрываться всеми видами облицовочных материалов. Плиты могут использоваться для сооружения съемной опалубки для бетонных работ (может использоваться несколько раз). ОСП можно использовать в качестве однослойных полов в легких строительных конструкциях.<br /> Широко применяется ОСП в строительстве. Ее используют в качестве съемной опалубки при бетонировании, для обшивки стен, потолка и создания чернового пола. Из ориентировано-стружечных плит создаются перекрытия, лестничные площадки, кровельная обрешетка. Перечислить все варианты применения этого материала в строительстве сложно.<br /> ОСП используют в мебельной промышленности для изготовления разных видов мебели. Из них делают ограждения, поддоны, разборные конструкции, пол в кузовах автотранспорта.</p>\n<p>ОСБ: общие характеристики<br /><br /> На основе отходов деревообрабатывающей промышленности производится большое количество видов стружечных материалов. Ориентировано-стружечная плита относится к таким же, но вместе с тем обладает множеством характеристик, выделяющих ее из общего ряда. Этот материал применяется в строительстве практически повсеместно. Используют его и в других сферах.<br /> OSB является композитным материалом, который состоит из трех стружечных слоев. Это отличает данный вид плиты от других, в которых стружка располагается без особого порядка. В наружных слоях стружка располагается в продольном направлении, а в центральном слое &ndash; перпендикулярно к поверхности. Чтобы плита имела монолитную структуру, материал пропитывается влагостойкими смолами и некоторыми другими веществами, а затем прессуется. Прессование осуществляется горячим методом. В результате получается прочный и недорогой материал, который пользуется популярностью в разных отраслях. Кроме того, стружечная плита такого типа сохраняет цвет натуральной древесины и ее структуру.<br /> ОСБ плита состоит из дерева на девяносто процентов и сохранила все преимущества данного материала. Недостатки (например, наличие сучков) исключаются непосредственно спецификой материала.<br /> Ориентировано-стружечные плиты отличаются небольшим весом, что делает их удобными в применении. Они имеют низкую теплопроводность и отличные звукоизолирующие характеристики. Для придания огнестойкости и защиты от негативного воздействия влаги применяют обработку поверхности специальными составами. В результате материал оказывается способен противостоять негативному воздействию внешних факторов.<br /> Среди разновидностей ОСП существуют не только классы, выделяемые по влагостойкости и особенностям применения, но и по отделке поверхностей. Бывают плиты лакированные, ламинированные и шпунтованные.<br /><br /> <br />Достоинства плит<br /><br /> Среди достоинств ОСБ листов следует отметить их высокие прочностные характеристики и жесткость. При этом плиты обладают малым весом, легко монтируются и обрабатываются. Ориентировано-стружечные плиты не расслаиваются и не подвержены короблению. Они не повреждаются насекомыми и гнилью. Такой материал не обладает гигроскопичностью, т.е. он не впитывает влагу. Это делает его одним из наилучших вариантов для отделки самых разных поверхностей. К достоинствам относится и высокая прочность на изгиб. Все характеристики в совокупности делают ОСП долговечным материалом.</p>',NULL,0,0,0,0,0,0,0,0,NULL),(428,27,'Плиты QuickDeck',0.00,2,'/images/product/428.205x205.jpg',53,5,1,0,0,0,'/images/product/428.jpg',NULL,0,0,'','','Плиты QuickDeck','','','<p>литы QuickDeck 0<br />0<br />0<br />0<br />0<br />0<br />1<br /><br /><br /> Высококачественные строительные плиты QuickDeck, изготовлены из водостойких, древесностружечных плит, шпунтованных по всему периметру. Древесностружечная плита производится из экологически чистой древесины березы, осины и ольхи на самом современном технологичном оборудовании. Это позволяет добиваться высокой экологичности получаемого в результате продукта, одновременно обеспечивая ему высокие физико-механические характеристики.<br /><br /> Уникальность QuickDeck в гармоничном сочетании эксплуатационных характеристик материала и его экологичности. Сегодня именно этот набор характеристик особенно востребован в сегменте строительства и ремонта. Минимальное выделение вредных веществ в атмосферу (класс Е1) практически сопоставимо с аналогичными показателями натуральной древесины. Материалы с такими показателями разрешены к использованию в школах и дошкольных учреждениях.</p>\n<p>Основные характеристики:<br /><br /><br /> Удобные размеры плиты, ее состав и уникальные свойства делают плиту QuickDeck Pro идеальным решением в сфере черновой отделки пола, стен и потолка. После укладки плиты поверхность становится ровной, бесшовной и полностью предназначенной для финишной отделки.<br /> Монтаж плиты.<br /> Шпунтованное соединение плиты QuickDeck Pro позволяют производить укладку плиты на любое основание (бетонную стяжку, лаги, старый пол) без наличия специальных знаний и при соблюдении технологии укладки - практически не оставлять отходов, что значительно экономит бюджет.<br />Заблуждения:<br /><br />Распространенным заблуждением считается, что плита недостаточно прочная, что совершенно не соответствует действительности. Плита QuickDeck Pro по плотности превосходит OSB или фанеру, что позволяет использовать ее в различных видах строительных работ.</p>\n<p>Каковы же основные преимущества имеются у данного продукта перед ближайшими конкурентами?<br />Простота и удобство использования строительных плит QuickDeck позволяют ускорить и главное упростить весь процесс сборки, благодаря соединению на шпунте;<br />Значительное сокращаются сроки выполнения отделочных работ, что позволяет экономить как материальные так и трудовые ресурсы;<br />Плиты QuickDeck могут применяться в помещениях с повышенной влажностью;<br />Строительные плиты QuickDeck обладают великолепными эксплуатационными и прочностными характеристиками, что позволяет снизить общие нагрузки на несущие перекрытия всех конструкций;<br />В готовых конструкциях плиты QuickDeck создают идеально ровную прочную поверхность с высокими звуко-теплоизоляционными характеристиками;<br />Монтаж строительных плит QuickDeck не требует от работников каких то особых специальных навыков и инструментов;<br />Высокая экологичность строительных шпунтованных плит QuickDeck;<br />Отсутствие &laquo;мокрых&raquo; работ при использовании плит QuickDeck;<br />Свойства плит QuickDeck позволяют избежать скрипа при эксплуатации;<br />Большое многообразие сфер применения;</p>',NULL,0,0,0,0,0,0,0,0,NULL),(429,72,'7043-3+1',0.00,1,'/images/product/429.205x205.jpg',2,5,0,0,0,0,'/images/product/429.jpg',NULL,0,0,'','','','7043-3+1','','',NULL,0,0,0,0,0,0,0,0,NULL),(430,72,NULL,NULL,NULL,NULL,3,-1,0,0,0,0,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,0,NULL),(431,72,NULL,NULL,NULL,NULL,4,-1,0,0,0,0,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,0,NULL),(438,72,'8002-5+2CB',0.00,1,'/images/product/438.205x205.jpg',11,5,0,0,0,0,'/images/product/438.jpg',NULL,0,0,'','','','8002-5+2CB','','',NULL,0,0,0,0,0,0,0,0,NULL),(437,72,'8002-5+2',0.00,1,'/images/product/437.205x205.jpg',10,5,0,0,0,0,'/images/product/437.jpg',NULL,0,0,'','','','8002-5+2','','',NULL,0,0,0,0,0,0,0,0,NULL),(434,72,'7043-6+3',0.00,1,'/images/product/434.205x205.jpg',7,5,0,0,0,0,'/images/product/434.jpg',NULL,0,0,'','','','7043-6+3','','',NULL,0,0,0,0,0,0,0,0,NULL),(435,72,'8002-3+2',0.00,1,'/images/product/435.205x205.jpg',8,5,0,0,0,0,'/images/product/435.jpg',NULL,0,0,'','','','8002-3+2','','',NULL,0,0,0,0,0,0,0,0,NULL),(436,72,'8002-3+2CB',0.00,1,'/images/product/436.205x205.jpg',9,5,0,0,0,0,'/images/product/436.jpg',NULL,0,0,'','','','8002-3+2CB','','',NULL,0,0,0,0,0,0,0,0,NULL),(439,72,'8008-3+1',0.00,1,'/images/product/439.205x205.jpg',12,5,0,0,0,0,'/images/product/439.jpg',NULL,0,0,'','','','8008-3+1','','',NULL,0,0,0,0,0,0,0,0,NULL),(440,72,'8008-3+1CB',0.00,1,'/images/product/440.205x205.jpg',13,5,0,0,0,0,'/images/product/440.jpg',NULL,0,0,'','','','8008-3+1CB','','',NULL,0,0,0,0,0,0,0,0,NULL),(441,68,'adhesive washproof bandage ',0.33,1,'/images/product/441.205x205.jpg',2,5,1,0,0,0,'/images/product/441.jpg',NULL,288,0,'30pcs/box','Бандаж','bandage','adhesive washproof bandage ','bendaggio','<p>Zhejiang Hongyu Medical Company&nbsp;is a 12 years manufacturer of <strong>medical plaster,</strong> <strong>first aid kit</strong>,<strong>bandage,medical tapes,</strong><strong>cotton swab </strong>