n Dress Mesh Cotton Embroidery Guipure Lace Fabric</strong></p>\r\n<p><strong>红色,粉红色,深紫色,黑色,白色</strong></p>',NULL,0,0,0,0,0,0,0,0,NULL),(947,27,'Секция нагревательная кабельная Fereezstop  Lite-15-8',2985.00,2,'/images/product/947.205x205.jpg',84,5,1,0,0,0,'/images/product/947.jpg',NULL,0,0,'','Секция нагревательная кабельная Fereezstop  Lite-15-8','','','','<p>Секция саморегулирующегося кабеля FreezStop Lite 15-8 (8 м)<br />Длина секции: 8 м<br />Номинальная мощность: 120 Вт<br />Габариты (в х ш): 4,7 х 9,3 мм<br />Цвет кабеля: Коричневый<br />Вес (нетто): 9,2 кг/100м<br />Минимальный радиус изгиба: 25 мм<br />Максимальная температура: 65 &deg;С<br />Минимальная температура монтажа: - 20 &deg;С<br />Напряжение питания: ` 220-240 В<br />Максимальное сопротивление защитной оплетки: 18,2 Ом/км<br />Пусковой ток при температурах: + 10&deg;С / -15&deg;С / -20&deg;С: 0,118 / 0,180 / 0,205 А/м<br />Гарантия производителя: 5 лет</p>\n<p></p>\n<p>В комплект поставки входит: <br /> 1. Двужильная нагревательная секция саморегулирующегося кабеля FreezStop Lite 15-8. <br /> 2. Паспорт на нагревательную секцию.<br /> В системе используются нагревательные секции из экранированного двухжильного саморегулирующегося кабеля. Нагревательная секция оснащена установочным проводом и заводскими соединительными и концевыми муфтами.<br /> &bull; представляют собой электрическую нагревательную ленту для предотвращения замерзания или поддержания заданной температуры трубопровода или резервуара.<br /> &bull; оснащенны монтажными концами и соединительными муфтами.<br /> &bull; кабель автоматически регулирует тепловыделение в зависимости от повышения или понижения температуры трубы.<br /> &bull; номинальная погонная мощность составляет ~ 15 Вт/м.п.<br /> &bull; не перегреваются и не перегорают при самопересечении.<br /> &bull; проверены на соответствие стандартам CENELEC / IEEE и российским стандартам для использования в обычной окружающей среде.<br /> &bull; предназначены для установки на трубопровод под теплоизоляцию.<br /> &bull; предназначены для устройства на трубопроводы, диаметром не более 100 мм.<br /> &bull; экономят время и трудозатраты.</p>',NULL,0,0,0,0,0,0,0,0,NULL),(948,27,'Терморегулятор   ТР  115 белый',1340.00,2,'/images/product/948.205x205.jpg',85,5,1,0,0,0,'/images/product/948.jpg',NULL,0,0,'','Терморегулятор   ТР  115 белый','','','','<p>Классический универсальный терморегулятор ТР 115 предназначен для управления системами электрообогрева и поддержания заданной фиксированной температуры. <br /><br />Терморегулятор ТР 115 позволяет снизить энергопотребление теплых полов путем поддержания температуры автоматического выключения системы теплого пола при достижении комфортного уровня обогрева и включением - в случае понижения температуры пола. Благодаря лаконичному дизайну, терморегулятор ТР 115удачно интегрируется в любой интерьер. Терморегулятор ТР 115 &ndash; простой, надежный и удобный в управлении прибор. <br />Терморегулятор ТР 115 оснащен выключателем, ручкой регулировки температуры и сигнальным светодиодом, индицирующим включенное состояние системы обогрева.</p>',NULL,0,0,0,0,0,0,0,0,NULL),(949,85,NULL,NULL,NULL,NULL,157,-1,0,0,0,0,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,0,NULL),(950,85,NULL,NULL,NULL,'/images/product/950.205x205.jpg',158,-1,0,0,0,0,'/images/product/950.jpg',NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,0,NULL),(951,85,NULL,NULL,NULL,'/images/product/951.205x205.jpg',159,-1,0,0,0,0,'/images/product/951.jpg',NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,0,NULL),(952,85,'水溶花边面料 网布+棉线水溶绣 130CM门幅 LF078',19.50,4,NULL,160,5,0,0,0,0,NULL,NULL,0,0,'','','','水溶花边面料 网布+棉线水溶绣 130CM门幅 LF078','','<p><strong>水溶花边面料 网布+棉线水溶绣 130CM门幅&nbsp;</strong></p>\r\n<p><strong>Water-soluable Lace Mesh Cotton Embroidery Lace Fabric in 130CM Width</strong></p>\r\n<p><strong>粉红色,天蓝色,巧克力色,紫色,白色</strong></p>',NULL,0,0,0,0,0,0,0,0,NULL),(953,85,'加强网纱+棉线绣花 韩版花边面料 1.3米宽幅LF079',13.00,4,'/images/pr