стве дополнительного компонента при заливке фундамента и заполнении глубин;<br />Применяется для изготовления керамзитбетона и блоков из него;<br />Для теплоизоляции дренажных систем, тепло- и водоснабжения;<br />В качестве подложки грунта для растениеводства.<br /><br />Качественный керамзит имеет свойства:<br />Морозоустойчивость и огнестойкость, хорошую звуко- и теплоизоляцию;<br />Не содержит вредных веществ, полностью экологичный и безопасный;<br />Долговечный, не подвергается старению и воздействию окружающей среды, имеет отличную водостойкост</p>',NULL,0,0,0,0,0,0,0,0,NULL),(970,27,NULL,NULL,NULL,NULL,90,-1,0,0,0,0,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,0,NULL),(971,27,NULL,NULL,NULL,NULL,91,-1,0,0,0,0,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,0,NULL),(972,27,'ГВЛ Суперпол (элемент пола) 1200*600*20м  влагостойкий  KNAUF',275.00,2,'/images/product/972.205x205.jpg',92,5,1,0,0,0,'/images/product/972.jpg',NULL,0,0,'','ГВЛ Суперпол (элемент пола) 1200*600*20м  влагостойкий  KNAUF','','','','<p>КНАУФ-суперпол &mdash; элемент пола (ЭП) &mdash; представляет собой изделие заводской готовности к поэлементной сборке в конструкциях стяжек сборных оснований пола КНАУФ.<br /><br />Элементы пола изготавливаются путем склеивания двух влагостойких гипсоволокнистых листов (ГВЛВ по ГОСТ Р 51829-2001) размерами 1200х600х20 мм с взаимным смещением в двух перпендикулярных направлениях и образованием фальцев шириной 50 мм по периметру изделий. Общая толщина ЭП &mdash; 20 мм.</p>\n<p>Размеры, мм 1200х600х20<br />Масса элемента, кг около 18<br />Ширина фальцев, мм &ndash; нижнего слоя &ndash; верхнего слоя 50<br />Полезная площадь элемента, м2 0,75<br />Коэффициент теплопроводности, Вт/м С от 0,22 до 0,36<br />Коэффициент теплоусвоения, Вт/м С не более 6,2<br />Твердость лицевой поверхности, МПа не менее 20<br />Поверхностное водопоглощение, кг/м2 не более 1,0<br />Коэффициент паропроницаемости, Мг/м &bull; ч &bull; Па 0,12</p>\n<p>Показатели Значения<br />Группа горючести по ГОСТ 30244-94 Г1<br />Группа воспламеняемости по ГОСТ 30402-96 В]<br />Группа дымообразующей способности по ГОСТ 12.1.044-89 Д1<br />Группа токсичности по ГОСТ 12.1.044-89 Т1<br />Группа распространения пламени по ГОСТ Р 51032-97 РГ 1</p>\n<p>Преимущества</p>\n<p>Элемент пола (ЭП) &mdash; КНАУФ-суперпол повышает производительность труда и сокращает сроки производства работ.<br />Значительно сокращает расход клеящей мастики и винтов.<br />Позволяет минимизировать отходы и обеспечивать требуемую &laquo;разбежку&raquo; стыков (не менее 250 мм) за счет использования остатков ЭП предыдущих рядов.<br />Упрощает подгонку деталей стяжки в примыканиях к ограждающим конструкциям со сложной конфигурацией.</p>',NULL,0,0,0,0,0,0,0,0,NULL),(973,13,NULL,NULL,NULL,NULL,59,-1,0,0,0,0,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,0,NULL),(974,71,'Светодиодный комплект 32 W',9.90,1,'/images/product/974.205x205.jpg',5,5,0,0,0,0,'/images/product/974.jpg',NULL,0,0,'','Светодиодный комплект 32 W','','','','<p>Светодиодный комплект 32 ВТ, Срок гарантии 2 года</p>',NULL,0,0,0,0,0,0,0,0,NULL),(975,13,NULL,NULL,NULL,NULL,60,-1,0,0,0,0,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,0,NULL),(976,13,NULL,NULL,NULL,NULL,61,-1,0,0,0,0,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,0,NULL),(977,13,NULL,NULL,NULL,NULL,62,-1,0,0,0,0,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,0,NULL),(978,78,NULL,NULL,NULL,NULL,1,-1,0,0,0,0,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,0,NULL),(979,50,NULL,NULL,NULL,NULL,106,-1,0,0,0,0,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,0,NULL),(980,94,'编织袋',1.65,4,'/images/product/980.205x205.jpg',1,5,0,0,0,0,'/images/product/980.jpg',NULL,0,0,'','','','编织袋','','',NULL,0,0,0,0,0,0,0,0,NULL),(981,98,NULL,NULL,NULL,NULL,1,-1,0,0,0,0,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,0,NULL),(982,9